import React from 'react'

function UserProfile({history}) {
    const userStyle = {}
    let user = JSON.stringify(history.location.state.values.name)

    user = user.replace(/['"]+/g, '');
    console.log(user);

    return (
        <div>
            Вы вошли как {user}
        </div>
    )
}

export default UserProfile
